import logo from './logo.svg';
import { Welcome } from "./components/findmusictogether"
import './App.css';
import testingcollapse from './testingcollapse';

class App extends Component {
  render() {
    return (
      <Fragment>
      <Router>
       <div className="App">
       <Route path="/" exact component={testingcollapse} />
       </div>
      </Router>
      </Fragment>
    );
  }
}

